import React from 'react';
import { Link } from 'react-router-dom';
import PokeMart from './components/assets/pokemart.png';

function App(props) {
  return (
    <div>
      <img src={PokeMart} alt='pokemart-pic' id='pokemart-1'></img>
      <img src={PokeMart} alt='pokemart-pic' id='pokemart-1'></img>
      <div>
        <h1>Welcome to the PokéMart!</h1>
        <h2>For all your Pokémon battling needs</h2>
        <div>
          <Link 
            to={{
              pathname: '/shop',
              state: props.location.state
            }}>See inventory</Link>
        </div>
      </div>
      <img src={PokeMart} alt='pokemart-pic'></img>
      <img src={PokeMart} alt='pokemart-pic'></img>
    </div>
  );
}

export default App;
